export class Movie {
    id: number = 0;
    title: string = '';
    author: string = '';
    genre: string = '';
    description: string = '';
    isbn: string = '';
    image: string = '';
    published: Date = new Date();
    publisher: string = '';
    category_id: number = 0;
  }
